import React from 'react';

class Main extends React.Component {
  render() {
      return (
        <div className="Main">
          <div className="Window1">
            <p> window1 </p>
          </div>
          <div className="Window2">
            <p> window2 </p>
          </div>
        </div>
      );
  }
}

export default Main;
